from dataclasses import dataclass
from typing import TypedDict, Union

from stw_gen_sample3_api.basic_types import *
from stw_py_api_runtime.gen_classes.telemetry.parse import Message as _Message




@dataclass
class DateTime(_Message):

    # Год
    year: uint16_t
    # месяц
    month: uint8_t
    # день месяца
    day: uint8_t
    # час
    hour: uint8_t
    # минута
    minute: uint8_t
    # секунда
    second: uint8_t


class DateTimeDict(TypedDict):

    # Год
    year: Union[uint16_t, int ]

    # месяц
    month: Union[uint8_t, int ]

    # день месяца
    day: Union[uint8_t, int ]

    # час
    hour: Union[uint8_t, int ]

    # минута
    minute: Union[uint8_t, int ]

    # секунда
    second: Union[uint8_t, int ]

